import React, { Component } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "./App.css";
import Dashboard from "./components/Dashboard";


import NewsFeed from "./containers/NewsFeed";
import Inventory from "./containers/Inventory";
import ClientSmall from "./containers/ClientSmall";
import ClientLarge from "./containers/ClientLarge";
import Orders from "./containers/Orders";
import PurchasingTool from "./containers/PurchasingTool";
import SalesAnalytics from "./containers/SalesAnalytics";
import ManagerTaskAssignment from "./containers/ManagerTaskAssignment";
import SalesTeamAnalytics from "./containers/SalesTeamAnalytics";
import MapOfSales from "./containers/MapOfSales";
import Discover from "./containers/Discover";
import AddRemoveUsers from "./containers/AddRemoveUsers";
import Permissions from "./containers/Permissions";
import SalesTeamDaily from "./containers/SalesTeamDaily";
import NoMatch from "./containers/NoMatch";


class App extends Component() {
  render() {
    return (
      <div>
        <Router>
          <div>
            <Dashboard>
              <Switch >
                <Route exact path="/" component={NewsFeed} />
                <Route exact path="/Inventory" component={Inventory} />
                <Route exact path="/ClientSmall" component={ClientSmall} />
                <Route exact path="/ClientLarge" component={ClientLarge} />
                <Route exact path="/Orders" component={Orders} />
                <Route exact path="/PurchasingTool" component={PurchasingTool} />
                <Route exact path="/SalesAnalytics" component={SalesAnalytics} />
                <Route exact path="/ManagerTaskAssignment" component={ManagerTaskAssignment} />
                <Route exact path="/SalesTeamAnalytics" component={SalesTeamAnalytics} />
                <Route exact path="/MapOfSales" component={MapOfSales} />
                <Route exact path="/Discover" component={Discover} />
                <Route exact path="/AddRemoveUsers" component={AddRemoveUsers} />
                <Route exact path="/Permissions" component={Permissions} />
                <Route exact path="/SalesTeamDaily" component={SalesTeamDaily} />
                <Route component={NoMatch} />
              </Switch>
            </Dashboard>
          </div>
        </Router>
      </div>
    )
  }
};

export default App;
